import React from 'react'
import firebase from './firebase';

const MyFunc = () => {
    React.useEffect(() => {
        const msg = firebase.messaging();
        msg.requestPermission().then(() => {
          return msg.getToken();
        }).then((data) => {
          console.warn("token", data)
        })
      })
  return (
    <div>

    </div>
  )
}

export default MyFunc
